import React from 'react'

  export default class ShowAmiibo extends React.Component {

    render(){
      return(
        <div className="wishlist showAmiibo">
          <img className="showImg" src={this.props.amiiboShower.image} />
          <h2 >{this.props.amiiboShower.name}</h2>
          <h4>Amiibo Series: <br/><br/> <span>{this.props.amiiboShower.amiiboSeries}</span></h4>
          <h5>Type: <br/><br/><span>{this.props.amiiboShower.type}</span></h5>
        </div>
      )
    }
  }
